import './App.css';
import React, {useState, useEffect} from 'react';

function App() {

  const url ="https://jsonplaceholder.typicode.com/users";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return fetch(url)
      .then((res) => res.json())
      .then((d) => setData(d))
  }

  useEffect(() => {
    fetchInfo()
  }, [])

  return (
    <div className="App">
        <h1>List of Users</h1>
        <div>
          {
            data.map((dataObj, index) => {
              return (
                <p>{dataObj.name}</p>
              )
            })
          }
        </div>
    </div>
  );
}

export default App;
